function add(a, b) {
    return a + b;
}
function minus(a, b) {
    return a - b;
}
function divide(a, b) {
    return a / b;
}
function multiply(a, b) {
    return a * b;
}
function power(a, b) {
    return a ** b;
}
function radical(a) {
    return Math.sqrt(a);
}
export { add, minus, divide, multiply, power, radical };
